Очень эффектно тут выглядит лозунг на колорадской ленте: вечная память героям!  Но…..Герои явно  нуждаются не только  в «вечной памяти» но и в рассоле.
Невзоров
@nevzorovtv

Русская культура имеет не только  возвышенное «лицо», но и очень вороватые «руки».  Как видим, Херсонский городской музей полностью ограблен, все содержимое экспозиций выломано и увезено. Вот так, грабя, отжимая, воруя все и всюду - и наполнялось «сакральное музейное пространство страны».
Невзоров
@nevzorovtv

🖍Примечательно, что эти стихи пишут не украинцы и не представители «малых народов рф». Пишут русские, которые сейчас живут в россии. Война сорвала все покровы, сожгла все мифы. Огромное количество людей увидели подлинное лицо страны, разглядело ее природу, лишило всех грёз и иллюзий. Война в Украине, как Колумб-Америку открыла настоящую россию во всей ее «красе».
Невзоров
@nevzorovtv

Это прекрасно.
Невзоров
@nevzorovtv

Странные претензии. Чья бы «корова мычала», но только не «корова россии». Все, что делает россия на земле Украины уже почти девять месяцев- ежедневное, ежеминутное преступление.  Скулёж путинской пропаганды напоминает известную жалобу чикатило на то, что ему при задержании поставили фингал.  Что бы не произошло на войне - виноват в этом всегда только тот, кто войну начал.  Если россия не хочет, чтобы ее солдатики умирали - пусть уберёт их из Украины.
Невзоров
@nevzorovtv

Новые партии русских пленных.
Невзоров
@nevzorovtv

Крайне интересная, содержательная и красноречивая экспертиза возможностей HIMARS 227мм. Целая поэма о сложных и глубоких отношениях HIMARS и КАМАЗ.
Невзоров 
@nevzorovtv

То что лукашенко невменяем и «врет, как путин» давно известно. Обсуждать его бред про разгон старого трактора МТЗ 50 до 280 км в час уже не интересно. Но!!!!! Обратите внимание на благоговейные рожи журналистов, слушающих эту ахинею. Ни один не осмелился ни возразить, ни засмеяться.
Невзоров
@nevzorovtv

Скоро Новый год. Многие  российские «девчонки и мальчишки» получат подарки с фронта. Конечно, сохраняется интрига. Не известно, каждый ли гроб будет украшен гирляндами, лампочками и хлопушками.
Невзоров
@nevzorovtv

🔞 У одного из «задвухсоченных»  под Херсоном мобиков, в кармане обнаружен телефон с такой вот видеозаписью. Понятно, что здесь запечатлена воспитательная работа с «личным составом»,  процесс разъяснения основ российской духовности и патриотизма. Никаких дополнительных сведений владелец телефона дать не мог по причине отсутствия рта и части черепа.
Невзоров
@nevzorovtv

🖍 Может и не хотел пригожин сунуть заточку под ребра россии, но засадил так уж засадил. Вероятно, нечаянно.  Но теперь никто не вытащит.  Так россию еще никто не опускал и  не раздевал. Три века страна прикидывалась пафосной державой:  эполеты, орлы, эрмитажи, своды законов, пушкины-фигушкины…. А на деле, оказался  весь этот «III Рим» - простой «малиною», где блатняк крутит на усталом х#ю и царей и президентов и законы.
Невзоров
@nevzorovtv

И ведь сидит же какой то подлейший гад и с абсолютно серьезным выражением лица говорит медведеву: «ну,  димк, ты огонь,  ты шамфор! Ты пиши, пиши, такой дар нельзя скрывать от людей». Льстивый гад изощренно стебется, а бедный медведев верит и радостно строчит и строчит свои полоумства.
Невзоров
@nevzorovtv

Мобики узнали, что на них прут украинские танки. Но офицер не растерялся и дал команду делать противотанковые «ежи». Мобики сделали 4 штуки и почувствовали себя в полной безопасности.  Никогда ещё танки так не хохотали.
Невзоров
@nevzorovtv

Да понятно, что признают. Трудно не признать очевидного. Пара поколений будет расхлёбывать шизофренические проделки путина.
Невзоров
@nevzorovtv

🖍 Мир пока не готов принять, как аксиому ,что «россия  врет всё». Мир не понимает, что сегодня это страна лжи, где любая правда по любому вопросу является уголовно наказуемым преступлением и считается «изменой родине»,  разрушением традиционных ценностей и экстремизмом. Такое нелегко осознать. Поэтому Эрдоганы и Байдены будут «принимать во внимание», ковыряться и «расследовать» в полном соответствии со всеми военно- бюрократическими процедурами.
Невзоров
@nevzorovtv

Конфликт электричества и путина закончится  тем, что к его последнему стулу будут поданы 2700 в. отличного переменного тока.  А поскольку  история  очень любит «показывать язык», то,  вполне возможно, что все  2700 будут сделаны на какой- нибудь украинской ГРЭС или АТЭС.
Невзоров
@nevzorovtv

⚡️Война, даже начатая  без всякой причины обычным идиотом, всегда имеет отличный шанс разрастись во всемирное и глобальное событие,  которое сотрет с лица земли и идиота и его страну.
Невзоров
@nevzorovtv

Как и собаки, войны очень похожи на своих владельцев. Путинская война - не исключение из этого правила. Она такая же трусливая, подлая и бессмысленная, как и ее хозяин.
Невзоров
@nevzorovtv

На фронте появилось новое словечко - «заенотить».
Невзоров
@nevzorovtv

В скобеевских  кругах президента, оказывается, ласково именуют пыней)).  Пропагандисты любят вас, владимир владимирович)). 
Лидия Невзорова
@nevzorovalidia

А если бы не  шизофрения путина, то не было бы ни фронта, ни мобилизаций, ни вдов, ни смертей, ни плачущих детей, ни позора и развала страны. Да, не было бы и симонян.
Невзоров
@nevzorovtv

Ага, ну вот и ещё одна голова «размозжена кувалдой». Чтобы заставить так истерить и унижаться  прожжённую ялтинскую торговку,  тётку прошедшую «все тяжкие» и всё на свете  видавшую -  ее надо было  умело и изощрённо запугать насмерть, выбить и выдавить из неё всякое достоинство и разум, оставив в бедной тётке только один страх, животный ужас ожидания «кувалды». На видео зафиксировалось не  «раскаяние», а изощренная жестокость режима, его готовность унижать и расплющивать без всякого следствия и суда. Это уже «химически чистый» фашизм. Такое было лишь в Германии 40-х. Россия перешла черту. Теперь, для неё, возвращение в адекватность - только через глобальную катастрофу. Да! На видео - дама, виновная лишь в том, что включила в своём ресторанчике песню Сердючки. Повторяю. Дама не украла, не убила, не выдала врагам секрет изготовления граммофона. Она всего лишь включила для посетителей «не ту» музыку. Через семь минут за теткой приехали, увезли и начали с ней «работать».
Невзоров
@nevzorovtv

Ну, белоручки какие. Их брезгливость понятна. Но репутация лаврова все же не повод отменять традиционное историческое фото. В конце-концов можно было накинуть на голову путинского министра  пластиковый мешок, но групповое фото все-таки сделать.
Невзоров
@nevzorovtv

Выжатые  из городов и посёлков, путинские мобики отсиживаются в лесополосах. Мирное население тут не поубиваешь и не понасилуешь. Некого. Но русский солдат  все равно не скучает и сложа руки не сидит. На  брошенных позициях путинцев обнаружено множество повешенных хомячков. Были грызуны перед смертью изнасилованы или нет - пока не установлено.
Невзоров
@nevzorovtv

Над Херсоном поднят Украинский флаг. Как и всякое торжество справедливости - сцена завораживающая и крайне мощная.
Невзоров
@nevzorovtv

Талантливая инициатива. Теперь понятно, что енот был арестован, как главный свидетель и сейчас даёт показания.
Невзоров
@nevzorovtv

Это так, к слову о том, что бегство из Херсона «без потерь» для путинских. Мне присылают оттуда много видео, но я выбрал самое «корректное», без особой кровищи, выпущенных кишек, да ещё и с офигевшими, но живенькими курочками.
Невзоров

@nevzorovtv

Киево- печерская лавра. Толпишка местных попов и их злобно-испуганная реакция на чрезвычайно важные сегодня слова. Любуйтесь.
Невзоров
@nevzorovtv

Пока бунты мобиков выглядят относительно невинно. Но очень скоро и они сообразят, во что их втравили. Тогда ситуация изменится. Подробнее об этом - сегодня в программе «Наповал».
Невзоров
@nevzorovtv

🖍Ах, какая неожиданность!  Сколько раз надо повторить: УПЦ- это полномочный филиал РПЦ МП, «плоть от плоти» чекистской московской организации, это «гундяевская контора», работающая на путина. По какой причине эта организация ещё не вышвырнута из Украины, мне не очень понятно.
Невзоров
@nevzorovtv

Воспитатели зря мучаются сами и зря мучают детей разучиванием гимна. Когда эти дети подрастут гимн будет совсем другой.
Невзоров
@nevzorovtv

Не удивительно, что все помыслы у всех - об Украине и о том, как и чем ей можно помочь. Весьма уважаемый мною Чичваркин предлагает следующий вариант: https://www.instagram.com/p/Ckx4_SqsDVs/?igshid=MDJmNzVkMjY=
Невзоров
@nevzorovtv

Следует отметить фантастическую меткость и экономность украинской артиллерии. Два снаряда - две  русские БМД.
Невзоров
@nevzorovtv

Вот. «русские слоних не кусают». Или «своих не бросают». И то и другое выражение -бессмыслица.  Ещё как бросают. Причём массово. По всей Херсонщине брошенные солдаты,  и слуги «русского мIра» из местных. Они не поместились в забитый  ворованными унитазами и картинами эвакуационный транспорт. Вместо них «спасали» краденный коньяк и стиралки. Не помогли ни слёзы, ни мольбы, ни «связи».
Невзоров
@nevzorovtv

К туше прилагается рецепт приготовления нового национального блюда «уола амтан», что означает « вкус сына». Для придания аутентичного вкуса,жаркое следует приправить танковой соляркой, а блюдо украсить обрывками ватника.
Невзоров
@nevzorovtv

Конец незаметен только тем, кто всегда повернут к нему задом.
Невзоров
@nevzorovtv

🖍 Суровикин, шойгу и по., привычно врут о выводе  всей путинской техники из Херсона. Из очень надежного источника, (который никогда ещё подводил) известно другое. И это только «первое впечатление», только та техника и вооружения , что на  «на виду», на «поверхности». Херсон - город не маленький ( 145 км.кв). По мере прочёсывания и зачистки, в ангарах, сараях, ремзонах - будут обнаружены еще несколько десятков  русских танков, бтр, бмп.
Невзоров
@nevzorovtv

Ватные военкоры бьются в эпилептических припадках.
Невзоров
@nevzorovtv

А зачем ракеты-то?  Просто  в Украину посылается г-н луговой. Там, привычным движением руки он заражает полонием-210 водопроводы, больницы, школы, супермаркеты, овощебазы и продовольственные склады. Напомню, что этот идиот, призывающий к террору ( депутат госдумы, разумеется) официально признан судом виновным в терроризме с применением радиоактивного поражающего вещества, что подкреплено вердиктом ЕСПЧ в Страсбурге и объявлен в международный розыск как особо опасный преступник.
Невзоров
@nevzorovtv

Все выяснилось со стремоусовым. Обычное, банальное ДТП. Просто не пропустил Хаймарс справа. Ясновидящие и спириты уже заявили, что кирюша прислал первые селфи с жириком и кобзоном.
Невзоров
@nevzorovtv

На девятом месяце войны путинских танкистов потянуло на откровенность. Они сменили штатные люки на канализационные. Вероятно, это тонкий намёк на содержимое танка.
Невзоррв
@nevzorovtv

Любопытно, когда, наконец, звание «героя россии» начнут давать енотам? Почему-то без звезды «г.р» до сих пор пляшет киркоров и бьется в припадках соловьев. Понятно, что путину не жалко «звёздочек»  и он цепляет их на кого попало.
Невзоров
@nevzorovtv

Когда в россии начнутся реальные  вооруженные протесты, то государственная дума рф  решение о  тотальных казнях примет не большинством, а единогласно.
Невзоров
@nevzorovtv

Теперь части россиян придётся расстаться с мечтой поскорее кремироваться  и больше никогда не видеть рожи в телевизоре.  Так что этот вариант «эмиграции» тоже отваливается. Примечательно, что мобилизация проредила штаты крематориев по всей стране. Операторы печей, газовщики, одевальщики- уходят умирать в Украину. Вероятно, часть крематориев россии придётся перевести на самообслуживание.
Невзоров
@nevzorovtv

А вот эта идея очень хорошая. С учётом того, что на плечи именно этих поколений ляжет основная тяжесть  вооруженных восстаний и Гражданской войны, то умение стрелять, прятаться и бинтовать будет очень кстати. С хренью про «основы и принципы российской государственности» тоже можно не переживать. Этот бред станет отличным обьектом для издевательств, или будет пропускаться мимо ушей, так же как, в своё время «уроки коммунизма».
Невзоров
@nevzorovtv

🖍Реальность такова, что у Зимбабве больше шансов высадиться на Плутон, чем у рф чинить «Боинги» и «арбузы». Большие заплаты из бересты на корпус, замена навигационных чипов деталями стиральных машин и «параллельных» утюгов  вопроса не решат. Этот «национальный центр» - блеф и распил. Поздно.  Время и средства растрачены на церкви, бессмертные полки, насилие и создание адовой роскоши для «вертикали власти».
Невзоров
@nevzorovtv

Питер окончательно выродился. Теперь даже кондитеры грубо льстят путину.   В  спб создают конфеты « путин» с начинкой из водки, чили, имбиря, символизирующие «страстность и харизму» диктатора. Какая, к черту водка? Какое, к дьяволу, чили?  Начинкой конфет «путин»  могут быть только опарыши, нафталин и козявки мертвого клоуна.
Невзоров
@nevzorovtv

Россия научилась поджимать хвост. Теперь она демонстрирует своё умение всем и всюду.  Ещё в феврале россия пыталась протащить свои военные корабли в Чёрное море,  «немножечко пострелять в Одессу» , но Турция нахмурилась и велела «подождать». Разжалобить турок так и не удалось. Промурыжив  россию 8 месяцев турки в проходе отказали.  Русские посудины постояли, поржавели, да и поперлись обратненько, во Владивосток.
Невзоров
@nevzorovtv

Как видите, православие и фашизм прекрасно себя чувствуют в «одном флаконе».  Они, как половинки единого целого. Надолго разлученные они сильно скучают друг без друга. Путинизм позволил им, наконец, сплавиться воедино.
Невзоров
@nevzorovtv

Херсон полностью разграблен путинским войском. Украли не только унитазы и картинные галереи, но даже паровозик из детского сада. Везут в Воронеж. Теперь ВСУ всё же придётся туда за паровозиком сходить.
Невзоров
@nevzorovtv

Мечты  путина сбываются.  Страна медленно но верно превращается в полицейско- поповское царствишко, где нет жизни, а есть лишь фуражки и рясы.Дегенератам удалось построить свой рай, где ангелы с лицами золотова стучат друг на друга . Все это уже было.  Точно такой же рай был взорван и сметен в 1917 году.  А судьба путинского рая будет ещё страшней.
Невзоров
@nevzorovtv

Да уж, вляпались обитатели Донбасса в «счастье по-путински». Поверили кремлю, не услышали его «геополитического хихиканья». Это Луганск. Переполненные кладбища давно не принимают покойников. Могилки свеженькие , это вам не «весемьлетбомбас».  Теперь хоронят и в газонах и на разделительных полосах шоссе. Такая вот красотища «русского мIра».
Невзоров
@nevzorovtv

Раньше при дорогах раскладывали грибы, морковку и  дыньки. При путине дынек не стало, зато появились трупы на любой вкус. В ассортименте и в любом количестве. На видео с дрона - мобилизанты из Подмосковья, свежие, охлажденные.
Невзоров
@nevzorovtv

