Сексуальные издевательства, изнасилования,«пикантные пытки»  швабрами и бутылками, ошпаривание, прижигание и искорёживание половых органов всегда были практикой российского следствия,  полиции, различных «фсин» и прочих кгб-фсб. Но раньше такие экзекуции применялись лишь к бомжам, уголовникам и пленным. Различным «поэтам» и прочей интеллигенции гуманно ломали пальцы и носы, но в трусы старались не залезать. Путинизм покончил с этим «табу», дав «зелёный свет» самым изощренным и унизительным пыткам в отношении инакомыслящих и вообще всех «лишних». Этого следовало ожидать.  И это логично. Народ, согласный на диктатуру должен привыкать к гантеле в заднице.

